      <div>
        <h1>My Messages</h1>
        {loading ? (
          <Spinner splash="Loading Messages..." />
        ) : (
          <div>
            {myMessages.length === 0 ? (
              <h3>No messages for you</h3>
            ) : (
              <div>
                {/* Similar structure to PatientMessages */}
                {/* ... */}
              </div>
            )}
          </div>
        )}
      </div>
    );
  };
  
  export default MyMessages;
